import { useState } from "react";

const Example = () => {
  const OPTIONS = ["Apple", "Banana", "Cherry"];

  const [selected, setSelected] = useState("Banana");

  return (
    <>
      <p style={{ textAlign: "center" }}>
        startフォルダの内容が表示されます。
        <br />
        練習用に使ってください！
      </p>

      <select value={selected}></select>
    </>
  );
};

export default Example;
